const Style = {
    body : {
        fontFamily: 'sans-serif',
        fontSize: '16px',
        backgroundImage: "url(../images/micheile-henderson-ZVprbBmT8QA-unsplash.jpg)",
        /* your image */
        backgroundSize: 'cover',
        backgroundRepeat: 'no-repeat'
      },

      header: {
        backgroundColor: 'rgba(0, 0, 0, 0.5)',
        height: '70px',
        paddingTop: '20px',
      },

      header_h1: {
        fontStyle: 'normal',
        fontWeight: 'normal',
        textTransform: 'uppercase',
        letterSpacing: '12px',
        color: 'white',
        float: 'left',
        cursor: 'pointer',
        paddingLeft: '25px',
      },

      navigation_ul : {
        float: 'right',
        paddingRight: '25px',
      },

      navigation_li: {
        listStyle: 'none',
        display: 'inline',
        padding: '7px 12px'
      },

      navigation_a: {
        textDecoration: 'none',
        color: 'white',
      },

      div_form: {
        width: '650px',
        height: '400px',
        display: 'block',
        margin: '0px auto',
        paddingTop: '50px',
        color:  'black',
        marginTop: '10px',
        /* background-color: red; */
      }
}

export default Style;
